import styled from 'styled-components';

export const Input = styled.input`
      display: block;
	  width: 65%;
	  height: 30px;
      line-height: 30px;
      border-radius: 42px;
      border: 1px solid #324B4E;
      float: right;
	  padding: 0 10px;
	  margin: auto;
      color: #777;

`;


export const Button = styled.div`
	width: 100px;
	height: 30px;
	line-height: 30px;
	color: #fff;
	background: #3194d0;
	border-radius: 15px;
	margin: 10px auto;
	text-align: center;
`;


export const ListWrapper = styled.div`
    padding: 10px 0;
    border-bottom: 1px solid #dcdcdc;
    font-size: 20px;    
`;

export const ListInfo =	styled.div`
	width: 500px;
	line-height: 24px;
	font-size: 15px;
    color: #909090;	
`;
